// src/pages/Navigation.js
import React from 'react';
import { Link } from 'react-router-dom'; // Certifique-se de incluir esta linha

function Navigation() {
  return (
    <nav>
      <ul>
        <li><Link to="/dashboard">Painel</Link></li>
        
      </ul>
    </nav>
  );
}

export default Navigation;
